(5, 'adar-khtt-altoary-oalazmat', '{\"en\":\"Management of emergency and crisis plans\",\"ar\":\"\\u0625\\u062f\\u0627\\u0631\\u0629 \\u062e\\u0637\\u0637 \\u0627\\u0644\\u0637\\u0648\\u0627\\u0631\\u0626 \\u0648\\u0627\\u0644\\u0627\\u0632\\u0645\\u0627\\u062a\"}', '{\"en\":\"The objective of this course is to develop the trainees\' skills and increase their capabilities to implement the policies, plans and procedures necessary to manage emergency and evacuation plans and prepare for crises and disasters to provide a safe work environment and to protect lives and property. As well as making sure that all workers know and train them on the procedures followed in emergencies and crises of all kinds.\",\"ar\":\"\\u0627\\u0644\\u0647\\u062f\\u0641 \\u0645\\u0646 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062f\\u0648\\u0631\\u0629 \\u0647\\u0648 \\u062a\\u0637\\u0648\\u064a\\u0631 \\u0645\\u0647\\u0627\\u0631\\u0627\\u062a \\u0627\\u0644\\u0645\\u062a\\u062f\\u0631\\u0628\\u064a\\u0646 \\u0648\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0642\\u062f\\u0631\\u0627\\u062a\\u0647\\u0645 \\u0644\\u062a\\u0646\\u0641\\u064a\\u0630 \\u0627\\u0644\\u0633\\u064a\\u0627\\u0633\\u0627\\u062a \\u0648\\u0627\\u0644\\u062e\\u0637\\u0637 \\u0648\\u0627\\u0644\\u0625\\u062c\\u0631\\u0627\\u0621\\u0627\\u062a \\u0627\\u0644\\u0644\\u0627\\u0632\\u0645\\u0629 \\u0644\\u0625\\u062f\\u0627\\u0631\\u0629 \\u062e\\u0637\\u0637 \\u0627\\u0644\\u0637\\u0648\\u0627\\u0631\\u0626 \\u0648\\u0627\\u0644\\u0625\\u062e\\u0644\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0627\\u0633\\u062a\\u0639\\u062f\\u0627\\u062f \\u0644\\u0645\\u0648\\u0627\\u062c\\u0647\\u0629 \\u0627\\u0644\\u0623\\u0632\\u0645\\u0627\\u062a \\u0648\\u0627\\u0644\\u0643\\u0648\\u0627\\u0631\\u062b \\u0644\\u062a\\u0648\\u0641\\u064a\\u0631 \\u0628\\u064a\\u0626\\u0629 \\u0639\\u0645\\u0644 \\u0622\\u0645\\u0646\\u0629 \\u0648\\u0644\\u062d\\u0645\\u0627\\u064a\\u0629 \\u0627\\u0644\\u0623\\u0631\\u0648\\u0627\\u062d \\u0648\\u0627\\u0644\\u064