(7, 'ntham-adar-otkyym-alslam', '{\"en\":\"Safety management and evaluation system\",\"ar\":\"\\u0646\\u0638\\u0627\\u0645 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0648\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629\"}', '{\"en\":\"The safety management system is concerned with the ability to identify, analyze and evaluate the safety of facilities and occupational health programs. With the advent of the Occupational Safety and Security Management System approach, establishments are increasingly required to have a comprehensive occupational safety and health program (Safety Management System -SMS).\",\"ar\":\"\\u064a\\u0647\\u062a\\u0645 \\u0646\\u0638\\u0627\\u0645 \\u0627\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0628\\u0627\\u0644\\u0642\\u062f\\u0631\\u0629 \\u0639\\u0644\\u0649 \\u062a\\u062d\\u062f\\u064a\\u062f \\u0648\\u062a\\u062d\\u0644\\u064a\\u0644 \\u0648\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0627\\u0644\\u0645\\u0646\\u0634\\u0622\\u062a \\u0648\\u0628\\u0631\\u0627\\u0645\\u062c \\u0627\\u0644\\u0635\\u062d\\u0629 \\u0627\\u0644\\u0645\\u0647\\u0646\\u064a\\u0629. \\u0648\\u0645\\u0639 \\u0638\\u0647\\u0648\\u0631 \\u0645\\u0646\\u0647\\u062c \\u0646\\u0638\\u0627\\u0645 \\u0627\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0648\\u0627\\u0644\\u0623\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0645\\u0647\\u0646\\u064a\\u062a\\u064a\\u0646 \\u0623\\u0635\\u0628\\u062d\\u062a \\u0627\\u0644\\u0645\\u0646\\u0634\\u0622\\u062a \\u0645\\u0637\\u0627\\u0644\\u0628\\u0629 \\u0628\\u0634\\u0643\\u0644 \\u0645\\u062a\\u0632\\u0627\\u064a\\u062f \\u0644\\u0648\\u062c\\u0648\\u062f \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0634\\u0627\\u0645\\u0644 \\u0644\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0648\\u0627\\u0644\\u0635\\u062d\\u0629 \\u0627\\u0644\\u06