(9, 'alslam-oalhmay-mn-almstshfyat', '{\"en\":\"Hospital safety and protection\",\"ar\":\"\\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0648\\u0627\\u0644\\u062d\\u0645\\u0627\\u064a\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062a\\u0634\\u0641\\u064a\\u0627\\u062a\"}', '{\"en\":\"The risks in hospitals are a fact that cannot be ignored, as hazardous materials, multiple gases, and flammable liquids are dealt with, so working in hospitals is one of the most dangerous places according to US OSHA standards, and there are many risks in hospitals in terms of providing health care without errors to maintain safety Patients, on the other hand, to apply the requirements and standards of safety and fire protection for hospitals to protect workers and patients from various risks. Saudi Arabia, as well as getting acquainted with the latest updates of international bodies specialized in the field of occupational safety and health in hospitals.\",\"ar\":\"\\u062a\\u0639\\u062a\\u0628\\u0631 \\u0627\\u0644\\u0645\\u062e\\u0627\\u0637\\u0631 \\u0627\\u0644\\u0645\\u0648\\u062c\\u0648\\u062f\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0633\\u062a\\u0634\\u0641\\u064a\\u0627\\u062a \\u062d\\u0642\\u064a\\u0642\\u0629 \\u0644\\u0627 \\u064a\\u0645\\u0643\\u0646 \\u062a\\u062c\\u0627\\u0647\\u0644\\u0647\\u0627 \\u062d\\u064a\\u062b \\u064a\\u062a\\u0645 \\u0627\\u0644\\u062a\\u0639\\u0627\\u0645\\u0644 \\u0645\\u0639 \\u0645\\u0648\\u0627\\u062f \\u062e\\u0637\\u0631\\u0629 \\u0648\\u063a\\u0627\\u0632\\u0627\\u062a \\u0645\\u062a\\u0639\\u062f\\u062f\\u0629 \\u0648\\u0633\\u0648\\u0627\\u0626\\u0644 \\u0642\\u0627\\u0628\\u0644\\u0629 \\u0644\\u0644\\u0627\\u0634\\u062a\\u0639\\u0627\\u0644 \\u060c \\u0644\\u0630\\u0644\\u0643 \\u0641\\u0625\\u0646 \\u0627\\u0644\\u0639\\u0645\\u0644 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0633\\u062a\\u0634\\u0641\\u064a\\u0627\\u062a \\u0645\\u0646 \\u0623\\u0643\\u062b\\u0631 \\u0627\\u0644\\u0627\\u0645\\u0627\\u0643\\u0646 \\u